PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE matches (
    match_id TEXT PRIMARY KEY,
    match_timestamp INTEGER NOT NULL,
    match_date DATETIME,
    time_ago_number INTEGER,
    time_ago_unit TEXT,
    -- Raw JSON for complete preservation
    raw_json JSON NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);
COMMIT;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE match_clubs (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    match_id TEXT NOT NULL,
    club_id TEXT NOT NULL,
    club_name TEXT,
    date TEXT,
    game_number TEXT,
    goals INTEGER,
    goals_against INTEGER,
    losses INTEGER,
    match_type INTEGER,
    result INTEGER,  -- 1=win, 2=loss, 4=draw, 16385=win by DNF
    score INTEGER,
    season_id TEXT,
    team_id TEXT,
    ties INTEGER,
    winner_by_dnf INTEGER,
    wins INTEGER,
    -- Club details
    region_id TEXT,
    -- Custom kit data
    stad_name TEXT,
    kit_id TEXT,
    crest_asset_id TEXT,
    -- Store full customKit JSON for all the color codes
    custom_kit_json JSON,
    FOREIGN KEY (match_id) REFERENCES matches(match_id),
    UNIQUE(match_id, club_id)
);
COMMIT;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE match_players (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    match_id TEXT NOT NULL,
    club_id TEXT NOT NULL,
    player_id TEXT NOT NULL,
    player_name TEXT,
    -- Stats
    assists INTEGER,
    cleansheetsany INTEGER,
    cleansheetsdef INTEGER,
    cleansheetsgk INTEGER,
    goals INTEGER,
    goalsconceded INTEGER,
    losses INTEGER,
    mom INTEGER,  -- Man of the Match
    namespace INTEGER,
    passattempts INTEGER,
    passesmade INTEGER,
    pos TEXT,  -- Position
    rating REAL,
    realtimegame INTEGER,
    realtimeidle INTEGER,
    redcards INTEGER,
    saves INTEGER,
    score INTEGER,
    shots INTEGER,
    tackleattempts INTEGER,
    tacklesmade INTEGER,
    wins INTEGER,
    -- Pro attributes
    vproattr TEXT,  -- The attribute string
    vprohackreason TEXT,
    FOREIGN KEY (match_id) REFERENCES matches(match_id),
    UNIQUE(match_id, player_id)
);
COMMIT;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE match_aggregates (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    match_id TEXT NOT NULL,
    club_id TEXT NOT NULL,
    assists INTEGER,
    cleansheetsany INTEGER,
    cleansheetsdef INTEGER,
    cleansheetsgk INTEGER,
    goals INTEGER,
    goalsconceded INTEGER,
    losses INTEGER,
    mom INTEGER,
    namespace INTEGER,
    passattempts INTEGER,
    passesmade INTEGER,
    pos INTEGER,
    rating REAL,
    realtimegame INTEGER,
    realtimeidle INTEGER,
    redcards INTEGER,
    saves INTEGER,
    score INTEGER,
    shots INTEGER,
    tackleattempts INTEGER,
    tacklesmade INTEGER,
    vproattr INTEGER,
    vprohackreason INTEGER,
    wins INTEGER,
    FOREIGN KEY (match_id) REFERENCES matches(match_id),
    UNIQUE(match_id, club_id)
);
COMMIT;
